  \"2016-07-27T22:47:14.616818\",\n\t\"name\": \"medicine-lake-national-wildlife-refuge-narrative-report-january-february-march-april-1943\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Medicine Lake
  NWR outlines Refuge accomplishments from January through April of 1943. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
  mammals, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments and plantings. Resource management is outlined;
  topics include grazing and fur harvesting. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, and violations.
  N-R forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
